import React from 'react';
import "./Product.css";

function Product() {
    return ( 
        <div className="Product">
            <div className="product_info">
                <p>The lean startup</p>
                    <p className='product_price'>
                        <small>$</small>
                        <strong>19.99</strong> 
                    </p>
                    <div className="product_rating">
                    <p></p>
                    </div>
             </div>

             
         </div>
    );
}


export default Product;
